description:
Nar en grupp missionarer som tjanstgor som hjalparbetare i Myanmar
forsvinner i det vidstrackta grona helvetet, lamnar den vaksamme 
Vietnamveteranen sitt jobb som batreparator i Bangkok for att ansluta
sig till en grupp som beslutat sig for att ingen skada skall handa de
valvilliga philantroperna.
